INSERT INTO `t_place` VALUES ('10001', '华山', 'Upload/hs.jpg', '名胜山水', null, '110.089809', '34.527387', '奇险天下第一山，西峰绝壁，东峰日出，南峰奇松，北峰云雾，名不虚传。华山风景美不胜收，索道非常壮观，雪景也很美。门票性价比很高，而且服务真的很好。', '4.6', '180', '1531');
INSERT INTO `t_place` VALUES ('10002', '兵马俑', 'Upload/bmy.jpg', '历史遗迹', '273152480', '109.291934', '34.39444', '秦始皇陵兵马俑位于陕西省西安市以东35公里的临潼区秦始皇陵兵马俑陪葬坑内，于公元前246年至公元前208年修建。现已发现和真人、真马大小相似的陶俑、陶马近8000件。有车兵、骑兵和步兵等不同的兵种，排列整齐有序。陶俑的形象各不相同，被誉为“世界第八大奇迹”、“二十世纪考古史上的伟大发现之一”', '4.5', '120', '3224');
INSERT INTO `t_place` VALUES ('10003', '钟楼', 'Upload/zl.jpg', '历史遗迹', '', '108.95344', '34.265657', '钟楼和鼓楼不远，但是门票有点贵。不过是个很棒的地方，去看看还是不错的。晚上灯光一开很漂亮，特别宏伟，古朴大气，而且非常精致的机械设计。', '4.1', '35', '1371');
INSERT INTO `t_place` VALUES ('10004', '鼓楼', 'Upload/gl.jpg', '历史遗迹', '', '108.949903', '34.266395', '但凡历史悠久的地方都有鼓楼，离钟楼不远可以去看看。外观漂亮，建筑风格独特，而且很有历史感，但是将近四十的门票实在太贵。周围有很多美食和特色的街道，推荐去买矮子饼。', '4', '35', '875');
INSERT INTO `t_place` VALUES ('10005', '回民街', 'Upload/hmj.jpg', '古镇民俗', '', '108.949881', '34.267932', '西安最出名的一条小吃街，有很多种类的特色小吃。回民街上的建筑是清真风格，牛羊肉味道太过于浓郁但是很正宗，肉夹馍味道独特，推荐贾三家灌汤包，吃货们可以去看看。', '4.2', '0', '2473');
INSERT INTO `t_place` VALUES ('10006', '西安古城墙', 'Upload/xacq.jpg', '历史遗迹', '', '108.953323', '34.258153', '西安古城墙是中国古代著名的城垣建筑，也是保存最完整的古城墙。历史感很强大，而且雄伟的古城墙气势无比恢宏。在西安古城墙上骑自行车真的很爽，风景很好，可以去走走看看。', '4.4', '40', '2162');
INSERT INTO `t_place` VALUES ('10007', '书院门', 'Upload/sym.jpg', null, '', '108.953656', '34.259272', '西安人通常所说的“书院门”，指的是从碑林到关中书院门口的一条步行街。 从西安钟楼南行，将至南门往东拐，便是书院门古文化街，街口有一座古韵十足的高大牌楼，牌楼上方是“书院门”三个金色颜体大字，两旁是“碑林藏国宝，书院育人杰”的醒目对联，街道两旁是清一色仿古建筑，街道为青石铺砌。', '4', '0', '331');
INSERT INTO `t_place` VALUES ('10008', '陕西历史博物馆', 'Upload/lsbwg.jpg', null, '', '108.961428', '34.229386', '陕西历史博物馆浓缩了中原文化的精髓，能够感受陕西悠久的古代历史文明。门票是免费的，但是找个导游则更好。博物馆里面内容非常丰富，很多精美藏品，并且很多都是非常珍贵的文物。', '4.5', '0', '1850');
INSERT INTO `t_place` VALUES ('10009', '大雁塔', 'Upload/dyt.jpg', null, '', '108.970504', '34.227401', '大雁塔倒是值得上去一次看看的，但是又要收比较贵的门票，广场的喷泉很壮观，是保存比较完好的楼阁式塔。', '4.2', '50', '2465');
INSERT INTO `t_place` VALUES ('10010', '小雁塔', 'Upload/xyt.jpg', null, '', '108.948943', '34.247136', '著名唐代佛塔，是唐朝都城长安（西安）保留至今的两处重要建筑之一。 小雁塔的塔形秀丽，被认为是唐代精美的佛教建筑艺术遗产，小雁塔在唐、宋朝时期一直叫“荐福寺塔”，至于“小雁塔”之名，则和“大雁塔”的名称有关。', '4.1', '30', '618');
INSERT INTO `t_place` VALUES ('10011', '大唐芙蓉园', 'Upload/dtfry.jpg', null, '', '108.980379', '34.218454', '景区内环境比较好，但就是票价有点贵。很大气的仿古园林，感觉印象最深的还是梦回大唐歌舞表演。', '4.1', '120', '1246');
INSERT INTO `t_place` VALUES ('10013', '大明宫国家遗址公园', 'Upload/dmgyzgy.jpg', null, '', '108.972371', '34.29647', '唐大明宫是东方园林建筑艺术的杰出代表，被誉为丝绸之路的东方圣殿。大明宫面积很大，超大的开放公园，遗址复建等正在建设中。大气恢弘的含元殿，是其中最壮观的宫殿。', '3.9', '60', '382');
INSERT INTO `t_place` VALUES ('10014', '华清池', 'Upload/hqc.jpg', null, '', '109.219934', '34.370442', '杨贵妃的故事赋予了华清池浪漫唯美的色彩，唐风建筑很多，园林设计很美，景点维护的也不错。票价较贵，导游很专业，讲解很仔细，服务也很好，而且温泉不错。', '4', '110', '1417');
INSERT INTO `t_place` VALUES ('10015', '骊山', 'Upload/ls.jpg', null, '', '109.216498', '34.358687', '骊山国家森林公园，位于陕西省西安市临潼县城南，距离西安市区30多公里，最高峰九龙顶海拔1301.9米。', '3.9', '70', '572');
INSERT INTO `t_place` VALUES ('10016', '曲江池遗址公园', 'Upload/qjcyzgy.jpg', null, '', '108.988649', '34.207565', '遗址公园再造曲江南湖、曲江流饮、汉武泉、宜春苑、凤凰池等历史文化景观，再现曲江地区“青林重复，绿水弥漫”的山水人文格局。而且适合散步的地方。', '4.2', '0', '311');
INSERT INTO `t_place` VALUES ('10017', '秦岭野生动物园', 'Upload/qlysdwy.jpg', null, '', '108.856896', '34.05842', '秦岭野生动物园位于秦岭北麓浅山地带，距西安市区28公里。是集野生动物移地保护、科普教育、旅游观光、休闲度假等功能于一体的综合性园林项目。西安秦岭野生动物园是西北首家野生动物园。', '3.9', '100', '249');
INSERT INTO `t_place` VALUES ('10018', '曲江海洋馆', 'Upload/qjhyg.jpg', null, '', '108.98598', '34.221252', '西安曲江海洋馆，位于西安曲江新区规划的核心旅游景园区内，西临大雁塔，南与大唐芙蓉园一路之隔，和曲江南湖、寒窑等人文景观交相辉映。 海洋馆由四馆八区组成：海豚表演馆，海洋科普馆，热带雨林馆、海底隧道四馆及入场区、科普区、雨林体验区、海底体验区、中央演艺区、消费服务区、海底大观区、设备区等八区。 ', '3.9', '100', '159');
INSERT INTO `t_place` VALUES ('10019', '大唐不夜城', 'Upload/dtbyc.jpg', null, '', '108.970811', '34.221185', '大唐不夜城项目位于西安曲江新区举世闻名的大雁塔脚下，是陕西省、西安市重点建设项目。 该项目以盛唐文化为背景，以唐风元素为主线，以体验消费为特征，着力打造集购物、餐饮、娱乐、休闲、旅游、商务为一体的一站式消费天堂——中国第一文化MALL。', '4', '0', '331');
INSERT INTO `t_place` VALUES ('10020', '翠华山', 'Upload/chs.jpg', null, '', '109.013004', '33.999399', '风景区拥有秀美的湖光山色和其国内罕见的山崩地貌。植被茂密景色宜人，沿途风光也很美，山顶尤其壮观。夏日去会很凉爽，游客众多。', '4.2', '70', '290');
INSERT INTO `t_place` VALUES ('10021', '沣峪口', 'Upload/fyk.jpg', null, '', '108.81001', '34.038828', '沣峪口位于陕西省西安市长安区滦镇街道，是秦岭的一条山沟，沿途有观音禅院等景点。', '4', '0', '129');
INSERT INTO `t_place` VALUES ('10022', '西安植物园', 'Upload/zwy.jpg', null, '', '108.966355', '34.213595', '位于西安市大雁塔旁，占地面积20公顷，收集保存植物3400余种（含品种），保存国家重点保护的珍稀濒危植物32科70余种，是目前西北地区引种保存植物种类最多的植物园。 ', '4.1', '10', '113');
INSERT INTO `t_place` VALUES ('10023', '西安事变纪念馆', 'Upload/xnsbjng.jpg', null, '', '108.973596', '34.263583', '西安事变纪念馆设在张学良公馆，1986年12月在纪念西安事变五十周年之际正式对外开放。 周恩来、叶剑英等到西安后，即住在张公馆的东楼，在中楼与张学良、杨虎城会谈，并和二人与南京政府代表宋子文等谈判。', '4.1', '0', '242');
INSERT INTO `t_place` VALUES ('10025', '高冠瀑布', 'Upload/ggpb.jpg', null, '', '108.767723', '34.004075', '高冠瀑布位于陕西省西安市户县东南20千米的秦岭北麓圭峰山的高冠峪口。 因高冠峪两侧有一高耸的秀峰，形似巨人，头戴高帽，故被称为高冠峪，对瀑布亦呼为高冠瀑布。', '3.8', '15', '112');
INSERT INTO `t_place` VALUES ('10026', '半坡遗址博物馆', 'Upload/bpyzbwg.jpg', null, '', '109.052839', '34.27718', '西安半坡遗址是一个非常值得去的一个景点，景点就两个馆值得参观，人民的智慧赞不绝口，环境古朴典雅，而且很有意义。馆内陈列比较丰富，在历史文化悠久的西安。', '4', '65', '181');
INSERT INTO `t_place` VALUES ('10027', '大唐西市', 'Upload/dtxs.jpg', null, '', '108.915005', '34.252812', '全国唯一在原址上重建的项目。 在唐朝当时西市占地1600 多亩，建筑面积100万平方米，有220 多个行业，固定商铺4 万多家，被誉为“金市”，是当时世界上最大的商贸中心“ ', '4.1', '0', '149');
INSERT INTO `t_place` VALUES ('10028', '西安博物院', 'Upload/xabwy.jpg', null, '', '108.945837', '34.244196', '西安博物院位于陕西省西安市南门外友谊西路。由文物展馆区、小雁塔以及荐福寺为核心的历史名胜区、园林游览区三部分组成。西安博物院集博物馆、名胜古迹、城市园林为一体。2007年对外开放。以展示的珍贵文物，唐代千年古塔、悠扬的雁塔晨钟、秀丽的园林景观而闻名。', '4.3', '0', '160');
INSERT INTO `t_place` VALUES ('10029', '兴庆宫', 'Upload/xqg.jpg', null, '', '108.994344', '34.260003', '兴庆宫，位于唐都长安外郭城东部的兴庆坊（隆庆坊），这里曾是唐玄宗李隆基的旧宅，玄宗未即位前曾与其兄弟居住于此。兴庆宫是唐玄宗（唐明皇）时代的国家政治中心所在，也是和他的爱妃杨玉环（杨贵妃）长期居住的地方，宫内建有兴庆殿、南熏殿、大同殿、勤政务本楼，花萼相辉楼和沉香亭等建筑物。 兴庆宫历经扩建，占地达2016亩，超过我国现存最大、最完整的建筑群－－明清故宫的面积（1087亩）', '3.8', '0', '133');
INSERT INTO `t_place` VALUES ('10035', '广仁寺', 'Upload/grs.jpg', null, '', '108.93229', '34.279857', '坐落在西安城内西北角，是西北和康藏一带大喇嘛进京路过陕西时的行宫，因此又称“喇嘛寺”。 广仁寺是陕西省唯一的藏传佛教寺院，1703年由清圣祖康熙帝敕建，历史上起着凝聚、促进西北边陲多民族团结的作用。', '4.2', '20', '112');
INSERT INTO `t_place` VALUES ('10057', '乾陵', 'Upload/ql.jpg', null, '', '108.226309', '34.577231', '乾陵，位于陕西咸阳市乾县城北6公里的梁山上，是陕西关中地区唐十八陵之一。 乾陵是中国乃至世界上独一无二的一座两朝帝王、一对夫妻皇帝合葬陵。', '4.1', '122', '203');
INSERT INTO `t_place` VALUES ('10058', '袁家村', 'Upload/yjc.jpg', null, '', '108.545342', '34.597254', '袁家村坐落在礼泉县烟霞镇北面的九嵕山下，处在西咸半小时经济圈内，距西安一个小时车程，是目前全省乃至全国最受欢迎的乡村旅游胜地。', '4', '0', '143');
INSERT INTO `t_place` VALUES ('10070', '法门寺', 'Upload/fms.jpg', null, '', '107.911678', '34.439422', '法门寺位于陕西省宝鸡市扶风县城北10公里处的法门镇，东距西安市120公里，西距宝鸡市96公里。 法门寺旅游区是国家AAAAA级景区。始建于东汉末年，恒灵年间，距今约有1700多年历史，有“关中塔庙始祖”之称。发迹于北魏，起兴于隋，鼎盛于唐，被誉为“皇家寺庙”，因安置释迦牟尼佛指骨舍利而成为举国仰望的佛教圣地。', '4', '120', '249');
INSERT INTO `t_place` VALUES ('10110', '黄帝陵', 'Upload/hdl.jpg', null, '', '109.280487', '35.587062', '黄帝陵，是中华民族始祖黄帝轩辕氏的陵墓，位于黄陵县城北桥山。1961年，国务院将黄帝陵公布为全国第一批全国重点文物保护单位，号称“天下第一陵”。', '4.1', '85', '114');
INSERT INTO `t_place` VALUES ('10112', '宝塔山', 'Upload/bts.jpg', null, '', '109.5032', '36.600141', '宝塔山，位于延安城区中心，是革命圣地延安的标志性建筑，是游览延安的必去之地。山上现已建成为宝塔山公园，林木葱郁，环境优美。宝塔山是融自然景观与人文景观为一体、历史文物与革命旧址合二而一的著名风景名胜区。', '4', '65', '149');
INSERT INTO `t_place` VALUES ('10113', '延安革命纪念馆', 'Upload/yagmjng.jpg', null, '', '109.484352', '36.613968', '延安革命纪念馆位于宝塔区西北延河东岸。纪念馆内展出了大量珍贵革命文物、文献和照片，按历史顺序分列11个单元，400多米长的展览大厅，以1000多幅历史照片和800多件革命文物，生动、形象地再现了老一辈革命家在延安住窑洞、吃小米、驱日寇的光辉业绩。', '4.3', '0', '136');
INSERT INTO `t_place` VALUES ('10114', '枣园', 'Upload/zy.jpg', null, '', '109.428553', '36.633613', '枣园革命旧址位于延安城西北约8公里处，是中共中央书记处1943年10月至1947年3月的所在地。枣园又名延园，占地面积54万多平方米。园内树木葱郁、绿草如茵、花团锦簇。', '4.1', '0', '124');
INSERT INTO `t_place` VALUES ('10161', '壶口瀑布', 'Upload/hkpb.jpg', null, '', '110.455575', '36.151234', '中国黄河上的著名瀑布,世界上最大的黄色瀑布 位于宜川县城以东35公里，吉县城西45公里处的秦晋大峡谷黄河河床中,东濒山西省临汾市吉县壶口镇，西临陕西省延安市宜川县壶口乡。', '4.6', '75', '408');
INSERT INTO `t_user` VALUES ('1', '程', 'cheng@qq.com', '89975c5e5d407916e8080d137c48ddd7', '男', '1989-5-11', '315');
INSERT INTO `t_user` VALUES ('2', '王斌', 'wang@qq.com', '362941d29aa54817a10871f726f42e3f', '男', '1987-4-26', '324');
